import React from 'react';
import Child from '../pure/child';

export const Father = () => {

    function showMessage(text) {
        alert(`Message: ${text}`);
    }


    return (
        <div>
            <Child name='Javier' send={showMessage()}></Child>
        </div>
    );
}
